const Home = () => {
  const [bodyPart , setBodyPart] = useState('all')
  const [excercises , setExercises] = useState([])
  return (
    <div className='body'>
      <HeroBanner/>
      
      <SearchExcercises
        setExercises={setExercises}
        bodyPart={bodyPart}
        setBodyPart={setBodyPart}
      />
      <Excercises
       setExercises={setExercises}
       bodyPart={bodyPart}
       e
      />
    </div>
  )
}

export default Home
